import MagneticWrapper from "./components/magneticWrapper";
import "./App.css";

function App() {
  return (
    <div className="App">
      <MagneticWrapper>
        <div style={{ background: "rebeccapurple" }}>Matilda</div>
      </MagneticWrapper>
    </div>
  );
}

export default App;
